@import "@/assets/default/scss/style"; // 공통 

.guide-wrapper {
	max-width: 1100px;
	margin: 0 auto;
	padding: 40px 0 100px
}

.guide-title {
	text-align: center;
	margin-bottom: 30px;
	color: #000;
	font-weight: 700
}

.card {
	margin-bottom: 20px
}

.card dt {
	background: #f4f5f9;
	padding: 10px
}

.card dd {
	padding: 12px 0
}

.card .title {
	font-weight: 700;
	color: #000;
	font-size: 20px
}

.card .title-sub {
	font-size: 18px;
	font-weight: 500;
	padding: 15px 0 10px;
	margin-bottom: 0;
	color: #000
}

.card .color-box {
	width: 100px;
	border-radius: 5px;
	display: inline-block;
	padding: 10px;
	color: #fff;
	text-align: center
}

.form-check-wrap {
	margin-top: 6px
}

.guide-gatter-5 {
	margin-right: 5px
}

.guide-gatter-5>:last-child {
	margin-right: 0
}

.stretch {
	align-items: stretch;
	justify-content: stretch;
	display: flex;
	flex-direction: column
}

.stretch {
	height: 100%
}

.bg-dark {
	background: #333
}

.table-custom {
	width: 100%;
	text-align: left;
	background: #fff;
	table-layout: fixed;
	border: 1px solid #ddd
}

.table-custom thead th {
	text-align: center;
	font-weight: 700;
	color: #333;
	background-color: #f4f5f9;
	border-top: 2px solid #9398a1
}

.table-custom td,
.table-custom th {
	padding: 8px 10px;
	border: 1px solid #e8e8e8;
	border-bottom: 0;
	color: #666;
	font-size: .875rem
}

.table-custom td.status,
.table-custom th.status {
	color: #777
}

.table-custom td.primary-1,
.table-custom th.primary-1 {
	color: var(--primary-1)
}

.table-custom .line td {
	border-top-color: #6b6d77
}

.table-custom .line-gr td {
	border-top-color: #c2c2cc
}

a {
	text-decoration: underline
}
